      bugData: "1000",
      codereview_logo: Codereview,
      codereviewData: "28%",
      unit_test_logo: Unittesting,
      unitTestData: "0%",
    },
    {
      logoUrl: Talocity,
      projectName: "Talocity",
      status: "Inprogress",
      project_condition2: "H-Risk",
      startDate: "12 Aug",
      stopDate: "12 Jun",
      completionPercentage: "67",
      delay: "delayed by 5 days",
      completionComments: "5days to go",
      dependency_logo: Dependencies,
      dependency_percent: "45%",
      bug_logo: Newbuglogo,
      bugData: "1000",
      codereview_logo: Codereview,
      codereviewData: "0%",
      unit_test_logo: Unittesting,
      unitTestData: "0%",
    },
    {
      logoUrl: Relias,
      projectName: "Relias",
      status: "Inprogress",
      project_condition2: "H-Risk",
      startDate: "12 Aug",
      stopDate: "12 Jun",
      completionPercentage: "91",
      delay: "delayed by 5 days",
      completionComments: "5days to go",
      dependency_logo: Dependencies,
      dependency_percent: "91%",
      bug_logo: Newbuglogo,
      bugData: "1000",
      codereview_logo: Codereview,
      codereviewData: "0%",
      unit_test_logo: Unittesting,
      unitTestData: "0%",
    },
  ];

  return (
    <div className="home-main-container__home-container">
      <div className="home-main-container__main-container">
        <div className="home-main-container__tiles-container">
          {tilesData &&
            tilesData.length > 0 &&
            tilesData.map((item, index) => <Totaldata key={index} {...item} />)}
        </div>
        <Centreelement />
        <div
          className="home-main-container__project_idividual_table"
        >
          {projectdata &&
            projectdata.length > 0 &&
            projectdata.map((datas, index) => (
              <Projectdetails key={index} {...datas} />
            ))}
        </div>
      </div>
    </div>
  );
}

export default Homepage;
